import React from 'react';
import './HomePage.css';
import resim1 from '../assets/resim1.png';
import resim2 from '../assets/resim2.png';
import resim3 from '../assets/resim3.png';
import resim4 from '../assets/resim4.png';
import resim5 from '../assets/resim5.png';
import resim6 from '../assets/resim6.png';

const HomePage = () => {
    return (
        <div className="home-page">
            <header className="header">
                <div className="logo-container">
                    <img src="/src/assets/logo.png" alt="Logo" className="logo" />
                </div>
                <nav className="nav-links">
                    <a href="/login" className="link icon-login">Giriş</a>
                    <a href="/cart" className="link icon-cart">Sepet</a>
                </nav>
            </header>
            <div className="image-gallery">
                <a href="/link1" className="image-frame"><img src={resim1} alt="Kahve" /></a>
                <a href="/link2" className="image-frame"><img src={resim2} alt="Çay" /></a>
                <a href="/link3" className="image-frame"><img src={resim3} alt="Meyveli Soda" /></a>
                <a href="/link4" className="image-frame"><img src={resim4} alt="Bitki Çayı" /></a>
                <a href="/link5" className="image-frame"><img src={resim5} alt="Meyve" /></a>
                <a href="/link6" className="image-frame"><img src={resim6} alt="Meyve" /></a>
            </div>
        </div>
    );
};

export default HomePage;
